import { BrowserRouter } from 'react-router-dom';
import AuthProvider from './contexts/auth';
import Routes from './routes';
import { ToastContainer } from "react-toastify"

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <ToastContainer autoclose={2000}/>
        <Routes/>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
